import React, {useState} from "react";

function HandleDelete(id){
    const [animals,setAnimals] = useState([])

    fetch(`http://localhost:3000/animals/${id}`,{
      method:"DELETE",
    })
    .then(()=>{
      setAnimals(animals.filter((animal)=> animal.id !== id))
    })
}

export default HandleDelete;
